import React from 'react'

export const GlobalFilter = ({filter, setFilter}) => {
  return (
    <div className="w-1/10" style={{ float: 'left', marginLeft: '10px' }}>
        <span>
            
            <input value={filter || ''} onChange={e=>setFilter(e.target.value)}/>
        </span>
    </div>

  )
}
